import React from "react";
import { auth } from "./firebase";
import logo from "../designFIles/IoT_Light.jpg";
import googleLoginImage from "../designFIles/googlelogin.png";
import "./logInIndex.css";
import { initializeApp } from "firebase/app";
import { getAuth, GoogleAuthProvider } from "firebase/auth";

const firebaseConfig = {
  apiKey: "AIzaSyB3S6pXq8fZXUKignwhjnmGEqFoZlD6CBE",
  authDomain: "iot-light-68724.firebaseapp.com",
  projectId: "iot-light-68724",
  storageBucket: "iot-light-68724.appspot.com",
  messagingSenderId: "127885636351",
  appId: "1:127885636351:web:47b9a5df0098ade0e652ca",
};

const firebaseApp = initializeApp(firebaseConfig);
const firebaseAuth = getAuth(firebaseApp);
const provider = new GoogleAuthProvider();

const handleGoogleSignIn = () => {
  auth
    .signInWithPopup(provider)
    .then((result) => {
      console.log("Successful login:", result.user);
    })
    .catch((error) => {
      console.error("Login error:", error);
    });
};

export const LogInIndex = () => {
  return (
    <div className="container">
      <img
        className="logo"
        src={logo}
        alt="Logo"
        style={{ width: "25rem", height: "auto" }}
      />
      <img
        src={googleLoginImage}
        alt="Google Login"
        className="google-login-button"
        onClick={handleGoogleSignIn}
      />
    </div>
  );
};
